from sympy import flatten
def a(n):
    if n==1: return 1
    L=[n]
    while not 1 in L:
        L=sorted(list(set(flatten([[3*k + 1, k/2] if k%2==0 else 3*k + 1 for k in L]))))
    return len(L)
